import React, { useState, useRef } from "react";
import { useNavigate } from "react-router-dom";
import {
  Box,
  Button,
  Card,
  CardContent,
  TextField,
  Typography,
  Grid,
  Divider,
} from "@mui/material";
import axios from "axios";

const Home = () => {
  const navigate = useNavigate();
  const [roomIdInput, setRoomIdInput] = useState("");
  const [feedback, setFeedback] = useState({ name: "", email: "", message: "" });
  const [status, setStatus] = useState("SEND");
  const timerRef = useRef(null);

  const handleCreateRoom = () => navigate("/create");
  const handleJoinRoom = () => {
    if (roomIdInput.trim() !== "") navigate(`/${roomIdInput}`);
  };

  const handleFeedbackSubmit = async (e) => {
    e.preventDefault();
    if (timerRef.current) clearTimeout(timerRef.current);
    setStatus("Sent!");
    try {
      await axios.post(`${process.env.REACT_APP_SERVER}/feedback/`, { data: feedback });
      setFeedback({ name: "", email: "", message: "" });
    } catch (err) {
      console.error(err);
      setStatus("Error!");
    }
    timerRef.current = setTimeout(() => setStatus("SEND"), 5000);
  };

  return (
    <Box
      sx={{
        minHeight: "100vh",
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        px: 2,
        py: 6,
        backgroundColor: "#f9f9f9",
        gap: 6,
      }}
    >
      {/* Header */}
      <Typography
        variant="h3"
        sx={{
          fontWeight: "bold",
          color: "#333",
          mb: 2,
        }}
      >
        Hangman Online
      </Typography>
      <Divider sx={{ width: "100%", maxWidth: 400, mb: 4 }} />

      {/* Room Controls */}
      <Card
        sx={{
          width: "100%",
          maxWidth: 400,
          p: 3,
          borderRadius: 3,
          boxShadow: "0 4px 12px rgba(0,0,0,0.1)",
        }}
      >
        <Box sx={{ display: "flex", flexDirection: "column", gap: 3 }}>
          <Button
            variant="contained"
            color="primary"
            sx={{ py: 1.5, fontWeight: "bold" }}
            onClick={handleCreateRoom}
          >
            Create Room
          </Button>

          <TextField
            placeholder="Enter Room ID"
            value={roomIdInput}
            onChange={(e) => setRoomIdInput(e.target.value)}
            variant="outlined"
            fullWidth
          />

          <Button
            variant="contained"
            color="secondary"
            sx={{ py: 1.5, fontWeight: "bold" }}
            onClick={handleJoinRoom}
          >
            Join Room
          </Button>
        </Box>
      </Card>

      {/* How to Play */}
      <Card
        sx={{
          width: "100%",
          maxWidth: 600,
          p: 3,
          borderRadius: 3,
          boxShadow: "0 4px 12px rgba(0,0,0,0.1)",
        }}
      >
        <Typography
          variant="h5"
          sx={{ fontWeight: "bold", mb: 2, color: "#555" }}
        >
          How to Play Hangman
        </Typography>
        <Typography variant="body1" sx={{ color: "#666", lineHeight: 1.8 }}>
          1. One player sets a secret word. <br />
          2. Other players guess letters one by one. <br />
          3. Each wrong guess loses a life. <br />
          4. Complete the word before you run out of lives! <br />
          Have fun with friends or solo!
        </Typography>
      </Card>

      {/* Feedback */}
      <Card
        sx={{
          width: "100%",
          maxWidth: 600,
          p: 3,
          borderRadius: 3,
          boxShadow: "0 4px 12px rgba(0,0,0,0.1)",
        }}
      >
        <Typography
          variant="h5"
          sx={{ fontWeight: "bold", mb: 2, color: "#555" }}
        >
          Feedback
        </Typography>
        <form onSubmit={handleFeedbackSubmit}>
          <Grid container spacing={2}>
            <Grid item xs={12} md={4}>
              <TextField
                fullWidth
                label="Name"
                value={feedback.name}
                onChange={(e) => setFeedback({ ...feedback, name: e.target.value })}
                required
              />
            </Grid>
            <Grid item xs={12} md={4}>
              <TextField
                fullWidth
                label="Email"
                type="email"
                value={feedback.email}
                onChange={(e) => setFeedback({ ...feedback, email: e.target.value })}
                required
              />
            </Grid>
            <Grid item xs={12} md={4}>
              <TextField
                fullWidth
                label="Message"
                value={feedback.message}
                onChange={(e) => setFeedback({ ...feedback, message: e.target.value })}
                required
              />
            </Grid>
          </Grid>
          <Button
            type="submit"
            variant="contained"
            color="primary"
            sx={{ mt: 3, py: 1.5, fontWeight: "bold" }}
          >
            {status}
          </Button>
        </form>
      </Card>
    </Box>
  );
};

export default Home;
